import './navi.css'
import {Link} from 'react-router-dom'
function Nav () {
//   let history = useHistory();
// function name(){
//   history.push("/login");
// }  
  return (
        <nav>
    <Link to ='/' className="logoo">
      <h1>CUBOHOLIC</h1>
    </Link>
    <ul className="nav-links">
      <li className="hoverline" data-content="TIMER"><link >TIMER</link></li>
      <li className="hoverline" data-content="BATTLE"><link >BATTLE</link></li>
      <li className="hoverline" data-content="STATISTICS"><link >STATISTICS</link></li>
      <li className="hoverline" data-content="CONNECT"><link >CONNECT</link></li>
      <li className="hoverline" data-content="OPTIONS"><link >OPTIONS</link></li>
      <Link to= "/login"><button className="loginsignup" id="myButton">Login/Signup</button></Link>
    </ul>

    <div className="burger">
      <Link to = '/' >
        <div className="line1"></div>
        <div className="line2"></div>
        <div className="line3"></div>
      </Link>
    </div>
  </nav>
    )
}

export default Nav;
